webpackJsonp([0xa3a723cd3628],{3404:function(a,t){a.exports={data:{markdownRemark:{html:"<p>当時描いていたギャグものストーリー漫画 “ドラえもん のび太のめしがない！” の一コマ。\nある日、ごく普通の一日が始まるが、のび太は遅刻で朝食を逃し、体育で井戸に落ちて放置され昼食を逃し、とトンデモなアンラッキーが重なり、めしにありつけることなく数日間過ごすことになる。</p>\n<p>校舎が崩壊するくらいにのび太をフルボッコにする先生や、ジャンボジェットを UFO と勘違いして空気砲で破壊してしまうドラえもんなど、トンデモな展開もあった。</p>\n<p>残念ながら当時描いていたものは見つからず、このイラストは 1999 年頃に当時の画力を思い出しつつ再現したもの。</p>",frontmatter:{cover:null,date:"1996-12-01T00:00:00+09:00",strDate:"1996/11/30",title:"二次創作コミック “ドラえもん のび太のめしがない！”"}}},pathContext:{path:"/ja/blog/1996/12/01-doraemon/",langKey:"ja"}}}});
